import React from 'react';
import AIVisual from './components/AIVisual';
import './styles/globals.css';

function App() {
  return (
    <div style={{
      backgroundColor: '#0F172A',
      color: '#FFFFFF',
      minHeight: '100vh',
      overflow: 'hidden',
      position: 'relative',
    }}>
      <nav style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '20px 40px',
        maxWidth: '1400px',
        margin: '0 auto',
      }}>
        <div style={{ 
          fontSize: '24px', 
          fontWeight: 'bold',
          display: 'flex',
          alignItems: 'center',
          gap: '8px',
        }}>
          <span style={{
            color: '#38BDF8',
            fontSize: '28px',
          }}>ML</span>
          Research
        </div>
        <div style={{
          display: 'flex',
          gap: '40px',
        }}>
          <a href="#research" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Research</a>
          <a href="#projects" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Projects</a>
          <a href="#publications" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Publications</a>
          <a href="#contact" style={{ color: '#FFFFFF', textDecoration: 'none' }}>Contact</a>
        </div>
      </nav>

      <main style={{
        maxWidth: '1400px',
        margin: '60px auto',
        padding: '0 40px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        position: 'relative',
      }}>
        <div style={{ maxWidth: '600px' }}>
          <div style={{
            backgroundColor: 'rgba(56, 189, 248, 0.1)',
            padding: '8px 16px',
            borderRadius: '20px',
            display: 'inline-block',
            marginBottom: '24px',
          }}>
            <span style={{ color: '#38BDF8' }}>📊 Machine Learning Engineer</span>
          </div>

          <h1 style={{
            fontSize: '72px',
            lineHeight: '1.1',
            marginBottom: '24px',
          }}>
            Advancing
            <br />
            <span style={{ color: '#38BDF8' }}>ML</span> Research &
            <br />
            Applications
          </h1>

          <p style={{
            color: '#94A3B8',
            fontSize: '18px',
            lineHeight: '1.6',
            marginBottom: '40px',
          }}>
            Focused on deep learning optimization, computer vision, and natural language processing.
            Experienced in developing scalable ML pipelines and research implementations.
          </p>

          <div style={{
            display: 'flex',
            gap: '20px',
            marginBottom: '40px',
          }}>
            <a href="#research" style={{
              backgroundColor: '#38BDF8',
              color: '#0F172A',
              padding: '12px 24px',
              borderRadius: '30px',
              textDecoration: 'none',
              fontWeight: 'bold',
              transition: 'all 0.3s ease',
            }}>
              View Research
            </a>
            <a href="#projects" style={{
              border: '1px solid #38BDF8',
              color: '#38BDF8',
              padding: '12px 24px',
              borderRadius: '30px',
              textDecoration: 'none',
              fontWeight: 'bold',
              transition: 'all 0.3s ease',
            }}>
              See Projects
            </a>
          </div>

          {/* Research Metrics */}
          <div style={{
            display: 'flex',
            gap: '40px',
            marginBottom: '40px',
          }}>
            {[
              { label: 'Publications', value: '8+' },
              { label: 'Citations', value: '150+' },
              { label: 'Projects', value: '12+' },
            ].map((metric) => (
              <div key={metric.label}>
                <div style={{
                  fontSize: '32px',
                  fontWeight: 'bold',
                  color: '#38BDF8',
                  marginBottom: '4px',
                }}>
                  {metric.value}
                </div>
                <div style={{ color: '#94A3B8' }}>
                  {metric.label}
                </div>
              </div>
            ))}
          </div>

          {/* Tech Stack */}
          <div style={{
            display: 'flex',
            flexDirection: 'column',
            gap: '15px',
          }}>
            <div style={{ color: '#94A3B8' }}>Technical Expertise</div>
            <div style={{
              display: 'flex',
              flexWrap: 'wrap',
              gap: '10px',
            }}>
              {[
                'PyTorch', 'TensorFlow',
                'Computer Vision', 'NLP',
                'MLOps', 'CUDA',
                'Distributed Training', 'Model Optimization'
              ].map((tech) => (
                <div
                  key={tech}
                  style={{
                    padding: '6px 12px',
                    backgroundColor: 'rgba(56, 189, 248, 0.1)',
                    borderRadius: '15px',
                    color: '#38BDF8',
                    fontSize: '14px',
                  }}
                >
                  {tech}
                </div>
              ))}
            </div>
          </div>
        </div>

        {/* Right Content - ML Visual */}
        <AIVisual />
      </main>
    </div>
  );
}

export default App;
